import React, { useState } from 'react';
import './ZenithKeyController.css';

const ZenithKeyController = () => {
  const [apiKey, setApiKey] = useState('');
  const [appId, setAppId] = useState('');
  const [response, setResponse] = useState('');
  const [loading, setLoading] = useState(false);

  const testAPI = async () => {
    if (!apiKey || !appId) {
      setResponse('Bitte API-Key und App-ID eingeben');
      return;
    }

    setLoading(true);
    try {
      const res = await fetch('http://localhost:8080/something', {
        method: 'GET',
        headers: {
          'X-API-KEY': apiKey,
          'X-APP-ID': appId,
        },
      });

      const data = await res.json();
      setResponse(JSON.stringify(data, null, 2));
    } catch (error) {
      setResponse(`Fehler: ${error.message}`);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="zenith-controller">
      <h2>ZENITH SCSC Master Kontrollzentrum</h2>
      <div className="input-group">
        <label>API-Key:</label>
        <input
          type="text"
          value={apiKey}
          onChange={(e) => setApiKey(e.target.value)}
          placeholder="abcdef12345"
        />
      </div>
      <div className="input-group">
        <label>App-ID:</label>
        <input
          type="text"
          value={appId}
          onChange={(e) => setAppId(e.target.value)}
          placeholder="myappid98765"
        />
      </div>
      <button onClick={testAPI} disabled={loading}>
        {loading ? 'Teste...' : 'API Testen'}
      </button>
      <div className="response">
        <h3>Antwort:</h3>
        <pre>{response}</pre>
      </div>
    </div>
  );
};

export default ZenithKeyController;
